import React from "react";
import RouterAbout from "./RouterAbout";
import RouterService from "./RouterService";
import RouterContact from "./RouterContact";
import {Switch , Route } from "react-router-dom";

const Router = () => {
    return (
        <>
        <Switch>
            <Route path = "/" component = {RouterAbout}></Route>
            <Route path = "/service" component = {RouterService}></Route>
            <Route path = "/contact" component = {RouterContact}></Route>
        </Switch>

        </>
    );
}

export default Router;
